      <p>Expert-led corporate training across Technology, Marketing, Finance, Sales, and Communication.</p>
      <div className="hero-buttons">
        <button>Start Upskilling Today →</button>
        <button>Watch Demo ▶</button>
      </div>
    </section>
  );
}
